import {Routes, Route} from "react-router-dom";
import Home from "./routes/Home";
import Search from "./components/Search";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/search" element={<Search />} />
      </Routes>
    </div>
  );
}

export default App;
